import React from 'react';
import './App.css';
import Home from './Pages/Home';
import Connect from './Pages/Connect';
import Challanges from './Pages/Challanges';
import About from './Pages/About';


function App() {
  return (
    <div className="App">
      <Home />
      <About />
      <Connect />
      <Challanges />
    </div>
  );
}

export default App;
